import React, { Component } from 'react';
// import {GoogleMapContainer} from './components/GoogleMapContainer/GoogleMapContainer';

class App extends Component {

    // useEffect(() => {
    //   renderMap();
    // })

  componentDidMount() {
    this.renderMap()
  }

  renderMap = () => {
    console.log("render map called");
    loadScript("https://maps.googleapis.com/maps/api/js?key=AIzaSyD4bqhCOPhLTodbwADYYwuPDOwC0tYHE_M&callback=initMap");
    window.initMap = this.initMap;
  }

  initMap = () => {
    console.log('initMap called');
    var map = new window.google.maps.Map(document.getElementById('map'), {
      center: {lat: -34.397, lng: 150.644},
      zoom: 8
    });
  }

  render() {

    return (
      <main>
      <div id="map"></div>
    </main>
  )
}
}

function loadScript(url) {
  console.log('load script called');
  var index = window.document.getElementsByTagName("script")[0];
  var script = window.document.createElement("script");
  script.src = url;
  script.async = true;
  script.defer = true;
  index.parentNode.insertBefore(script, index);
}

export default App;
